// LL 2021

// Data from https://observablehq.com/@tonyhschu/anaglyph-isobands-terrain

const turtle = new Turtle();
const text = new Text();

let paths;
let polygons;

const scene = 0; // min=0 max=3 step=1 (Grand Canyon,Fish River Canyon,Cotahvasi Canyon,Perito Moreno Glacier)
const style = 1; /// min=0 max=1 step=1 (Polygons (fast),Polygons (slow))

const scale1 = 450, scale2 = 100;

function walk(i) {
    if (i==0) {
        polygons = new Polygons();
        paths = [];
        data[scene]['svg'].split('M').forEach(path => {
            paths.push([]);
            path.split('L').forEach(coord => {
                xy = coord.split(' ');
                if (xy.length >= 2) {
                    x = parseFloat(xy[1]);
                    y = parseFloat(xy[2]);
                    paths[paths.length-1].push([x, y]);
                }
            });
        });
        
        turtle.penup();
        turtle.goto(-90,-60);
        text.print(turtle, `${data[scene]['location']}`, .2);
    }
    
    var points = [];
    paths[paths.length-1-i].forEach(point => {
        x = (point[0] + scale1) / scale1 * scale2 - scale2;
        y = (point[1] + scale1) / scale1 * scale2 - scale2;
        points.push([x, y]);
    });
    drawPoints(points);
    
    return i + 1 < paths.length;
}

function drawPoints(points) {
    if (style == 0) {
        turtle.jump(points[points.length-1]);
        points.forEach(p=>turtle.goto(p));
    } else {
        const p1 = polygons.create();
        p1.addPoints(...points);
        p1.addOutline();
        polygons.draw(turtle, p1, true);
    }
}

